import React from 'react'
import Home from './Home'
import Welcome from './Welcome';
import Data from './Data';

function App() {
  return (
    <>
      {/* <Home age="28" name="rakib"/> */}
      <Welcome age={Data[0].name} name={Data[0].name}/>
      <Welcome age="21" name={Data[0].name}/>
      <Welcome age="20" name="Sajib"/>
    </>
  );
}

export default App;
